import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';
import Logo from '../Icons/icons8-sakura-96.png';

function Nav() {
  const navStyle = {
    color: 'white',
    size: 4

  };


  return (

    <nav>
    <img src={Logo}  alt="logo" />
      <ul className="nav-links">
        <Link style={navStyle} to='/graphs'>
        <li>Graphs</li>
        </Link>
        <Link style={navStyle} to='/map'>
        <li>Map</li>
        </Link>
      </ul>
    </nav>
  );
}
export default Nav;
